import style from "./Header.module.scss";
import { Container } from "../Container/Container";
export const Header = () => {
  return <div className={style.header}>
    <Container>
      <div className={style.header_container}>
        <div className={style.nav_top}>
          <ul>
            <li>О проекте</li>
            <li>Вакансии</li>
            <li>Контакты</li>
          </ul>
          <div></div>
        </div>
      </div>
    </Container>
  </div>;
};
